import React from "react";
import { Box, Link, Flex } from "@chakra-ui/core";

interface NavBarProps {}

const NavBar: React.FC<NavBarProps> = ({}) => {
  return (
    <Flex bg="tomato" p={4}>
      <Box ml={"auto"}>
        <Link>Login</Link>
        <Link>Register</Link>
      </Box>
    </Flex>
  );
};

export default NavBar;
